import React, { Component } from 'react';
import {ResponsiveContainer, LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend} from 'recharts';
class Chart extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: [
        {name: '10:00', "Chua bao gio em quen": 30, pv: 40, amt: 22},
        {name: '10:00', "Chua bao gio em quen": 50, pv: 30, amt: 33},
        {name: '10:00', "Chua bao gio em quen": 20, pv: 12, amt: 67},
        {name: '10:00', "Chua bao gio em quen": 10, pv: 45, amt: 43},
        {name: '10:00', "Chua bao gio em quen": 100, pv: 67, amt: 45},
        {name: '10:00', "Chua bao gio em quen": 90, pv: 11, amt: 25},
        {name: '10:00', "Chua bao gio em quen": 60, pv: 67, amt: 21},
      ]
    }
  }

  render() {
    const { data } = this.state;

    return (
      <ResponsiveContainer className="chart" height={300}>
        <LineChart 
         width={500} 
         height={300} 
         data={data}
         margin={{top: 5, right: 30, left: 20, bottom: 5}}
        >
        <XAxis dataKey="name"/>
        <YAxis/>
        <CartesianGrid strokeDasharray="3 3"/>
        <Tooltip/>
        <Legend />
        <Line type="monotone" dataKey="Chua bao gio em quen" stroke="#8884d8" activeDot={{r: 5}}/>
        <Line type="monotone" dataKey="pv" stroke="#82ca9d" activeDot={{r: 5}}/>
        <Line type="monotone" dataKey="amt" stroke="#ccc" activeDot={{r: 5}}/>
        </LineChart>
      </ResponsiveContainer>
    );
  }
}

export default Chart;
